import React from "react";
import "./Css/Searchbar.css";


function SearchBar({ query, setQuery, search }){



    return(

        <div className="search">
        <input 

        type="text" 
        placeholder="Search City ..." 
        value={query}
        onChange={(e) => setQuery(e.target.value)}
        onKeyPress={search}
        />




        </div>






    );
}

export default SearchBar;
